import React from 'react';
import bachelorArticle from '../assets/bachelor.png';
import './styles.css';

export default function Projects() {
    return (
        <div className="Body">
            <h1>Projects</h1>

            <ProjectCard imageSrc={bachelorArticle} />
        </div>
    )
}

const ProjectCard = ({ imageSrc }) => {
    return(
        <div>
            <img src={imageSrc} alt="Article" />
        </div>
    )
}
